export function getTextLength(text){
    let info = {}
    if (text) {
      info.textlength = text.length;
      info.text = text;
    }
    else {
      info.text = ' '
      info.textlength = 0 
    } 
    info.textlength > 0  ? info.isNullorEmpty = true : info.isNullorEmpty = false;

   return info;
  }
